import React from "react";

const Rank = () => {
  return (
    <div>
      <div className="white f3">
        {`${this.props.name}, Your current entry count is....`}
      </div>
      <div className="white f1">{this.props.entries}</div>
    </div>
  );
};

export default Rank;
